css:
@-moz-document domain('bienvenidoainternet.org'), url-prefix('http://bienvenidoainternet.org') {
  html {
    background-color: #002b36  !important;
    color:#586e75;
  }
  body {
    background-color: #002b36  !important;
    color:#586e75;
  }
  .logo {
    background-color: #002b36  !important;
    color:#586e75;
  }
  .reply {
    background-color: #073642  !important;
    color:#586e75;
  }
  .filetitle {
    background-color: #002b36  !important;
    color:#6c71c4;
  }
  .thumbnailmsg {
    color:#6c71c4;
  }
  a.rep {
    color:#6c71c4;
  }
  .postblock {
    background-color: #073642  !important;
    color:#6c71c4;
  }
  frameset {
    border: 0px;
    padding: 0px;
    margin: 0px;
    background-color: #002b36;
    color:#586e75;
  }
  body.home {
    background-color: #002b36  !important;
    color:#586e75;
  }
  
  body.mainpage {
    background-image: none;
    background-color: #002b36  !important;
    color:#586e75;
  }
  
  body.threadpage {
    background: #002b36;
    color: #000;
    color:#586e75;
  }
  body.backlogpage {
    background: #002b36;
    color: #000;
  }
  
  a {
    color: #6c71c4;
  }
  .mainpage #posts h2 a {
    color: #6c71c4;
  }
  
  .header {
    color:#586e75;
  }
  .slogan {
    color:#586e75;
  }
  .nav {
    background:#002b36;
  }
  #posts form {
    background:#002b36;
  }
  .outerbox {
    background:#002b36;
    border:0px;
    padding:0px;
    margin:0px;
  }
  .innerbox {
    border-color: #002b36;
    border:0px;
    padding:0px;
    margin:0px;
  }
  .thread {
    border:0px;
    padding:0px;
    margin:0px;
  }
  .mainpage #posts .thread {
    background: #002b36;
  }
  
  textarea {
    color:#586e75;
    background: #073642;
  }
  input {
    color:#586e75;
    background: #073642;
  }
  .line0 {
    background: #002b36;
  }
  .line1 {
    background: #002b36;
  }
  .tabtitle {
    background: #002b36;
    color:#586e75;
  }
  .tab {
    color: #586e75;
    background: #002b36;
  }
  frame {
    background: #002b36;
  }
  .postername {
    color: #859900;
  }
}
